import React, { Component } from "react";

export default class ComponentRendering extends Component {
  render() {
    const foods = this.props.foods;

    const elements = (
      <ol>
        {foods.map(val => {
          return (
            <li key={val.id}>
              {" "}
              {val.name} : {val.price}
            </li>
          );
        })}
      </ol>
    );

    return <div>{elements}</div>;
  }
}
